/* Hard
 * https://leetcode.com/problems/word-ladder/
 *
 * Todo: String operations can be further optimized?
 */

struct Solution;

use std::collections::{HashMap, HashSet, VecDeque};

impl Solution {
    pub fn ladder_length(begin_word: String, end_word: String, word_list: Vec<String>) -> i32 {
        let mut list_has_end_word = false;
        for word in word_list.iter() {
            if *word == end_word {
                list_has_end_word = true;
            }
        }
        if !list_has_end_word {
            return 0;
        }

        let mut min_length = 1;
        let mut word_list = word_list;
        word_list.push(begin_word.clone());

        let n = word_list.len();
        let mut visited: HashSet<String> = HashSet::with_capacity(n); //(word_list.len());
        visited.insert(begin_word.clone());
        let mut adj_list: HashMap<String, Vec<String>> = HashMap::with_capacity(n);

        for word in word_list {
            let mut w = word.clone().as_bytes().to_vec();
            for i in 0..w.len() {
                let o_c = w[i].clone();
                w[i] = 0x2E;
                let pattern = String::from_utf8(w.clone()).unwrap();
                match adj_list.get_mut(&pattern) {
                    Some(neighbors) => {
                        neighbors.push(word.clone());
                    }
                    None => {
                        let neighbors = vec![word.clone()];
                        adj_list.insert(pattern, neighbors);
                    }
                };
                w[i]= o_c;
            }
        }

        //BFS traversal
        let mut queue = VecDeque::<String>::with_capacity(n);
        queue.push_back(begin_word);

        while queue.len() > 0 {
            for _ in 0..queue.len() {
                if let Some(node) = queue.pop_front() {
                    if node == end_word {
                        return min_length;
                    }

                    let w = node.as_bytes().to_vec();
                    for i in 0..w.len() {
                        let mut w = w.clone();
                        w[i] = 0x2E;
                        let pattern = String::from_utf8(w).unwrap();

                        for word in adj_list[&pattern].iter() {
                            if !visited.contains(word) {
                                visited.insert(word.clone());
                                queue.push_back(word.clone());
                            }
                        }
                    }
                }
            }
            min_length += 1;
        }
        0
    }
}

fn main() {
    println!("Hello, world!");
}

